import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';

function ApiListContents({ apiId }) {
  const { api, loading, error } = useSelector((state) => state.api);

  console.log(apiId)
  console.log("名前",api.filter((apiItem) => apiItem.api_id == apiId)[0].api_name)
  return (
    <div className="ApiContents">
      <div className="ApiContents_ApiName">
        {api.filter((apiItem) => apiItem.api_id == apiId)[0].api_name}
      </div>
    </div>
  );
}

export default ApiListContents;
